    #share-button {
    display: block;
    width: 28px;
    height: 28px;
    position: absolute;
    right: 16px;
    top: 16px;
    z-index: 9;
    background: url(../img/share-sign.svg) no-repeat;
    background-size: 28px 28px;
    cursor: pointer;
    opacity: .8
}

#share-button:hover,
#share-button:focus {
    opacity: 1
}

#share-control {
    font-family: 'Roboto', sans-serif;
    display: block;
    width: 100%;
    height: 100%;
    position: absolute;
    top: 0;
    left: 0;
    background-color: rgba(0, 0, 0, .95);
    z-index: 99999;
}

#share-control .close-button {
    display: block;
    width: 22px;
    height: 22px;
    position: absolute;
    right: 16px;
    top: 16px;
    z-index: 9;
    background: url(../img/cross.svg) no-repeat;
    background-size: 22px 22px;
    cursor: pointer;
}

#share-control h2 {
    font-size: 26px;
    font-weight: 300;
    font-family: 'Roboto', sans-serif;
    margin-top: 13%;
    margin-bottom: 30px;
    color: #2d8ecd;
}

#share-control .video-url,
#share-control .embed-code {
    margin: 15px auto;
    width: 90%;
    margin-bottom: 30px;
}

#share-control .embed-code .title {

    text-align: left;
    display: inline-block;

#share-control .embed-code input {
    width: 60%;

    padding-right: 10px;

}

#share-control .video-url button,
#share-control .embed-code button {
    display: inline-block;
    background-color: rgba(255, 255, 255, .05);
    border: 1px solid #fff;
    line-height: 28px;
    padding-left: 30px;
    padding-right: 30px;
    outline: none;
    position: relative;
    right: auto;
    top: auto;
    border-radius: 0;
    padding-top: 0;
}

#share-control button:before {
    display: none;
}

#share-control .video-url button:hover,
#share-control .embed-code button:hover,
